import React from 'react';
import { BrowserRouter, Route, Routes, Navigate } from 'react-router-dom';
import PreHomepage from "./components/beforeHomepage/preHome";
import HomePage from "./components/homepage/homepage";

function App() {
  let [appState, setAppState] = useState({
    boards: [
      {
        name:"name",
        colunms:[
          {
            name:"name",
            cards:[
              {}
            ]
          }
        ] 
      }
    ],
    current_board: 0
  })
  appState.boards[appState.current_board]
  setAppState({...appState, current_board:3})
  // setList({...lists, foo:{...lists.foo, foo1:"a"}})
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/*" element={<PreHomepage />} />
          {localStorage.getItem('username') ?
            <>
              <Route path="/home" element={<Board appState={appState, setAppState}/>} />
              <Route path="/contact" element={<h1>Contact</h1>} />
            </>
            : <></>

          }
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
